var messages=document.querySelectorAll(".message");messages.forEach(e=>{e.querySelector(".message-header button").addEventListener("click",()=>{e.classList.toggle("ani-toright"),e.addEventListener("animationend",()=>{e.style.display="none"})})});var notifications=document.querySelectorAll(".notification");notifications.forEach(e=>{e.querySelector("button").addEventListener("click",()=>{e.classList.toggle("ani-toright"),e.addEventListener("animationend",()=>{e.style.display="none"})})});var tabs=document.querySelectorAll(".tabs");tabs.forEach(e=>{e.addEventListener("click",()=>{e.querySelectorAll("a").forEach((t,a)=>{t.addEventListener("click",t=>{e.querySelectorAll(".tabs li").forEach(e=>e.classList.remove("active")),e.querySelectorAll(".tabs li")[a].classList.add("active"),e.querySelectorAll(".tabs-content div").forEach(e=>e.classList.remove("active")),e.querySelectorAll(".tabs-content div")[a].classList.toggle("active")})})}),e.click()});